import React, { useState, useEffect } from 'react';
import axios from 'axios';
import BeaconMap from './BeaconMap';
import IncidentList from './IncidentList';
import './App.css';

function App() {
  const [incidents, setIncidents] = useState([]);
  const [beacons, setBeacons] = useState([
    // India - Western Ghats
    { id: 'BEACON_01', name: 'Valparai Cliff Edge', lat: 10.3270, lng: 76.9550, status: 'active', danger: 'Fatal Falls', country: 'India' },
    { id: 'BEACON_02', name: 'Munnar Flash Flood', lat: 10.0889, lng: 77.0595, status: 'active', danger: 'Drowning Risk', country: 'India' },
    { id: 'BEACON_03', name: 'Kodaikanal Rocks', lat: 10.2381, lng: 77.4892, status: 'active', danger: 'Rockfall', country: 'India' },

    // USA - National Parks
    { id: 'BEACON_04', name: 'Grand Canyon South Rim', lat: 36.0544, lng: -112.1401, status: 'active', danger: 'Fatal Falls', country: 'USA' },
    { id: 'BEACON_05', name: 'Yellowstone Geysers', lat: 44.4605, lng: -110.8281, status: 'active', danger: 'Thermal Burns', country: 'USA' },
    { id: 'BEACON_06', name: 'Yosemite Half Dome', lat: 37.7459, lng: -119.5332, status: 'active', danger: 'Fatal Falls', country: 'USA' },

    // Europe - Alps
    { id: 'BEACON_07', name: 'Matterhorn Avalanche', lat: 45.9763, lng: 7.6586, status: 'active', danger: 'Snow Burial', country: 'Switzerland' },
    { id: 'BEACON_08', name: 'Mont Blanc Crevasse', lat: 45.8326, lng: 6.8652, status: 'active', danger: 'Ice Fall', country: 'France' },

    // Australia - Outback
    { id: 'BEACON_09', name: 'Uluru Sacred Zone', lat: -25.3444, lng: 131.0369, status: 'active', danger: 'Heat Stroke', country: 'Australia' },
    { id: 'BEACON_10', name: 'Blue Mountains Cliff', lat: -33.7320, lng: 150.3105, status: 'active', danger: 'Fatal Falls', country: 'Australia' },

    // Asia - Himalayas
    { id: 'BEACON_11', name: 'Everest Base Camp', lat: 27.9881, lng: 86.9250, status: 'active', danger: 'Altitude Sickness', country: 'Nepal' },
    { id: 'BEACON_12', name: 'K2 Avalanche Zone', lat: 35.8808, lng: 76.5155, status: 'active', danger: 'Snow Burial', country: 'Pakistan' },

    // Africa - Safari
    { id: 'BEACON_13', name: 'Serengeti Wildlife', lat: -2.3333, lng: 34.8333, status: 'active', danger: 'Animal Attack', country: 'Tanzania' },
    { id: 'BEACON_14', name: 'Victoria Falls Edge', lat: -17.9243, lng: 25.8572, status: 'active', danger: 'Fatal Falls', country: 'Zambia' },

    // South America - Andes
    { id: 'BEACON_15', name: 'Machu Picchu Cliff', lat: -13.1631, lng: -72.5450, status: 'active', danger: 'Fatal Falls', country: 'Peru' },
    { id: 'BEACON_16', name: 'Patagonia Glacier', lat: -50.4684, lng: -73.0306, status: 'active', danger: 'Ice Fall', country: 'Argentina' }
  ]);

  useEffect(() => {
    fetchIncidents();
    const interval = setInterval(fetchIncidents, 5000); // Refresh every 5 seconds
    return () => clearInterval(interval);
  }, []);

  const fetchIncidents = async () => {
    try {
      const response = await axios.get('http://localhost:3000/api/incidents');
      setIncidents(response.data);
    } catch (error) {
      console.log('Backend not available - using demo data');
      // Demo data for development
      setIncidents([
        {
          _id: '1',
          beaconId: 'BEACON_01',
          timestamp: new Date(),
          latitude: 10.3270,
          longitude: 76.9550,
          blockchainTxHash: '0xabc123...',
          resolved: false
        }
      ]);
    }
  };

  return (
    <div className="App">
      <header className="header">
        <h1>ðŸš¨ Tourist Safety Beacon System</h1>
        <div className="stats">
          <div className="stat">
            <span className="number">{beacons.length}</span>
            <span className="label">Active Beacons</span>
          </div>
          <div className="stat">
            <span className="number">{incidents.length}</span>
            <span className="label">Total Alerts</span>
          </div>
          <div className="stat">
            <span className="number">{incidents.filter(i => !i.resolved).length}</span>
            <span className="label">Unresolved</span>
          </div>
        </div>
      </header>

      <div className="dashboard">
        <div className="map-section">
          <h2>Beacon Locations & Alerts</h2>
          <BeaconMap beacons={beacons} incidents={incidents} />
        </div>

        <div className="incidents-section">
          <h2>Recent Tourist Warnings</h2>
          <IncidentList incidents={incidents} onIncidentUpdate={fetchIncidents} />
        </div>
      </div>
    </div>
  );
}

export default App;
